import fajl from "./slike.json";

export default function Nesto(props){
   console.log(fajl.slike[0][0])
   return(
      <div className="Nesto">
         <h1>{props.children}</h1>
         <div className="kanticar">
            <img src={fajl.slike[0][0]} alt="slika preradjenog kamena"/>   
            
         </div>

      </div>
   )
}
